import React from "react";

import "./Project.css";

import Media from "react-bootstrap/Media";

const project = props => (
  <div>
    <Media as="li">
      <img className="project__image" src={props.image} alt={props.title} />
    </Media>
    <Media as="li">
      <Media.Body>
        <h5>{props.title}</h5>
        <p>{props.explanation}</p>
      </Media.Body>
    </Media>
  </div>
);

export default project;
